// Footer.js
import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
    return (
        <footer className="bg-light text-center text-lg-start">
            <div className="container p-4">
                <section className="mb-4">
                    <Link className="btn btn-outline-primary m-1" to="">
                        About Us
                    </Link>
                    <Link className="btn btn-outline-primary m-1" to="/contact">
                        Contact
                    </Link>
                    <Link className="btn btn-outline-primary m-1" to="/privacy">
                        Privacy Policy
                    </Link>
                </section>
                <div className="text-center">
                    <p>&copy; {new Date().getFullYear()} GOJO. All Rights Reserved.</p>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
